import styles from './Product.module.css'
import React from 'react'

function Product ({name,description,color,price,img,rate}) {


        return (
            <div className={styles.productCard}>
                <img src={img} alt={name} className={styles.productImage}></img>
                <span className={styles.productName}>{name}</span>
                <span className={styles.description}>{description}</span>
                <div className={styles.infoRow}><span>Цвет</span><span className={styles.infoValue}>{color}</span></div>
                <div className={styles.infoRow}><span>Рeйтинг</span><span className={styles.infoValue}>{rate}</span></div>
                <div className={styles.infoRow}><span>Цена</span><span className={styles.infoValue}>{price}</span></div>
            </div>
        )

}

export default React.memo(Product)
